// convert basic markdown to HTML
function formatText(input) {
    // Convert double asterisks to <b>...</b>
    let formatted = input.replace(/\*\*(.*?)\*\*/g, '<b>$1</b>');

    // Convert single asterisks to <i>...</i>
    formatted = formatted.replace(/\*(.*?)\*/g, '<i>$1</i>');

    return formatted;
}

// convert an .rg file to actual YAML
function convertToTraditionalYAML(inputYAML) {
  const lines = inputYAML.split('\n');
  const convertedLines = [];

  lines.forEach(line => {
    // Check for key-value pairs
    if (line.includes(':')) {
      const arr = line.split(':');
      const key = arr[0];
      var value = arr.slice(1).join(':');
      // remove extraneous whitespace
      value = value.trim();
      if (value) {
        // escape quotes
        value = value.replace(/"/g, '\\u0022');
        // convert markdown to HTML
        value = formatText(value);
        // surround in quotes
        value = `"${value}"`;
        convertedLines.push(`${key}: ${value}`);
      } else {
        convertedLines.push(line);
      }
    } else {
      // Leave non-key-value lines unchanged, with original indentation
      convertedLines.push(line);
    }
  });

  return convertedLines.join('\n');
}

// helper function to get tags (e.g. "hyph.", "2 wds.") for a clue, given its entry
function entryToTags(entry) {
  arr = [];
  const numWords = entry.split(' ').length;
  if (numWords > 1) arr.push(`${numWords} wds.`);
  const hasHyph = entry.includes('-');
  if (hasHyph) arr.push('hyph.');
  return arr;
}

// helper function to sort an array of clues by clue
function sortByClue(arr) {
    // Helper function to remove non-alpha characters and convert to lowercase
    const cleanString = (str) => str.replace(/[^a-zA-Z]/g, '').toLowerCase();

    // Sorting the array by cleaned "answer" values
    return arr.sort((a, b) => {
        const clueA = cleanString(a.clue);
        const clueB = cleanString(b.clue);

        // Comparing the cleaned strings
        if (clueA < clueB) return -1;
        if (clueA > clueB) return 1;
        return 0;
    });
}

// RG to iPuz
function rgToIpuz(rgStr, thorny=false) {
  // convert to actual YAML
  const actualYAML = convertToTraditionalYAML(rgStr);
  // convert to JS object
  const jsObj = jsyaml.load(actualYAML);
  // prepare the output object
  const iPuz = {
    "version": "http://ipuz.org/v1",
    "kind": ["http://ipuz.org/crossword#1"],
    // dimensions and puzzle are just placeholders
    "dimensions": {"height": 3, "width": 3},
    "puzzle": [ ["#", "#", "#"], ["#", "#", "#"], ["#", "#", "#"] ],
    "fakeclues": true,
    "clues": {
      "ROWS": [], "LIGHT": [], "MEDIUM": [], "DARK": []
    }
  };
  // load metadata
  ["author", "title", "copyright"].forEach( k => {
    iPuz[k] = jsObj[k] || "";
  });
  // change the title based on the puzzle type
  if (thorny) {
    iPuz['title'] += " (thorny version)";
  } else {
    iPuz['title'] += " (regular version)";
  }
  /** load clues **/
  // row clues first
  // uppercase letters to help with row clue numbering
  const UPPERCASE_LETTERS = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
  for (var i=0; i < jsObj['rows'].length; i++) {
    const letter = UPPERCASE_LETTERS.at(i);
    const clueArr = jsObj['rows'][i];
    // loop through clues for this letter
    for (var j=0; j < clueArr.length; j++) {
      var thisClue = clueArr[j]['clue'];
      const thisEntry = clueArr[j]['answer'];
      // the clue number is just the letter if there's only one clue
      // otherwise we do e.g. "B1" and "B2"
      var clueNum = `${letter}${j+1}`;
      if (clueArr.length == 1) clueNum = `${letter}`;
      // get the tags for the clue (based on the entry)
      const tags = entryToTags(thisEntry);
      if (tags.length) {
        const tagStr = tags.join(', ');
        thisClue += ` (${tagStr})`;
      }
      // push this to the list of clues
      iPuz['clues']['ROWS'].push([clueNum, thisClue]);
    }
  }

  // bloom clues
  ['light', 'medium', 'dark'].forEach( color => {
    var clueArr = jsObj[color];
    // in a "thorny" puzzle we alphabetize the clues
    if (thorny) clueArr = sortByClue(clueArr);
    // the rest proceeds like the rows clues did
    clueArr.forEach( clueObj => {
      var thisClue = clueObj['clue'];
      const thisEntry = clueObj['answer'];
      const tags = entryToTags(thisEntry);
      if (tags.length) {
        const tagStr = tags.join(', ');
        thisClue += ` (${tagStr})`;
      }
      // we add a bullet to the clues for readability
      iPuz['clues'][color.toUpperCase()].push(["â€¢", thisClue]);
    });
  });
  return iPuz;
}

// Base64 representation of a rows garden puzzle
const RG_IMG = 'data:image/png;base64,';

// convert rg to PDF
function rgToPDF(rg, thorny=false) {
  // convert to iPuz
  const iPuz = rgToIpuz(rg, thorny=thorny);
  // make a JSCrossword instance
  const xw_constructor = new JSCrossword();
  const xw = xw_constructor.fromIpuz(iPuz);
  console.log(xw);
  // create the pdf
  jscrossword_to_pdf(xw, options={"image": RG_IMG});
}
